  false,\n\t\"url\": null,\n\t\"notes\": \"The Light Detection and Ranging (LiDAR)
  dataset is a survey of the Hudson-Hoosic and Deerfield project area. The entire
  survey area for Massachusetts is approximately 690 square miles. The LiDAR point
  cloud was flown at a nominal post spacing of 2.0 meters for unobscured areas. The
  LiDAR data and derivative products produced are in compliance with the U.S. Geological
  Survey National Geospatial Program LiDAR Guidelines and Base Specifications, Version
  13-ILMF 2010. The flight lines were acquired by Northrop Grumman, Advanced GEOINT
  Solutions Operating Unit. Derivative products from the aerial acquisition include:
  high accuracy multiple return LiDAR data, both raw and separated into several classes,
  along with hydro flattening breaklines, bare earth DEM tiles, control points, and
  FGDC compliant XML metadata.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
